/* Compute Window Id for each table of the CDC Set from children to parents */
/* This computes consistency regarding Inserts and Updates */
update	<%=snpRef.getJrnInfo("JRN_FULL_NAME")%>
set	WINDOW_ID = 	(
			select	CDC.CUR_WINDOW_ID_INS
			from	<%=snpRef.getJrnInfo("CDC_SET_TABLE")%> <%=snpRef.getInfo("DEST_TAB_ALIAS_WORD")%> CDC
			where	CDC.CDC_SET_NAME = '<%=snpRef.getObjectName("L", snpRef.getJrnInfo("JRN_COD_MOD"), "D")%>'
			)
where	WINDOW_ID is null

/* Compute Window Id for each table of the CDC Set from parents to children */
/* This computes consistency regarding Deletes */
update	<%=snpRef.getJrnInfo("JRN_FULL_NAME")%>
set	WINDOW_ID =	(
			select	CDC.CUR_WINDOW_ID_DEL
			from	<%=snpRef.getJrnInfo("CDC_SET_TABLE")%> <%=snpRef.getInfo("DEST_TAB_ALIAS_WORD")%> CDC
			where	CDC.CDC_SET_NAME = '<%=snpRef.getObjectName("L", snpRef.getJrnInfo("JRN_COD_MOD"), "D")%>'
			)
where	WINDOW_ID is null
